import 'bootstrap/dist/css/bootstrap.min.css';
import React from "react";
import {
  Card,
  Button,
  CardDeck
 } from 'react-bootstrap';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


export default function App() {
  return (
    <Router>
      <h1 style={{paddingTop:'2%' , textAlign:'center'}} >Plateforme Esport</h1>
      <div style={{padding: '4%'}}>
        <nav>
        <CardDeck>
             <Card text-white bg-dark style={{ width: '18rem'  }}>
                  <Card.Img variant="top"  style={{ width: '50%', margin:'auto'}} src="https://www.flaticon.com/svg/static/icons/svg/1170/1170667.svg" />
                  <Card.Body>
                    <Card.Title>Statisitiques</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Link to="/">
                    <Button variant="dark">Home</Button>
                    </Link>
                  </Card.Body>
                </Card>
                <Card text-white bg-dark style={{ width: '18rem'  }}>
                <Card.Img variant="top"  style={{ width: '50%', margin:'auto'}} src="https://cdn0.iconfinder.com/data/icons/modern-future-technology-2/128/game-controller-psv-w-256.png" />
                  <Card.Body>
                    <Card.Title>Joueur PRO</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Link to="/about">
                    <Button variant="dark">About</Button>
                    </Link>
                  </Card.Body>
                </Card>
                <Card text-white bg-dark style={{ width: '18rem'  }}>
                <Card.Img variant="top"  style={{ width: '50%', margin:'auto'}} src="https://cdn.icon-icons.com/icons2/2428/PNG/512/twitch_black_logo_icon_147063.png" />
                  <Card.Body>
                    <Card.Title>Stream</Card.Title>
                    <Card.Text>
                      Some quick example text to build on the card title and make up the bulk of
                      the card's content.
                    </Card.Text>
                    <Link to="/users">
                    <Button variant="dark">Users</Button>
                    </Link>
                  </Card.Body>
                </Card>
          </CardDeck>
        </nav>

        {/* A <Switch> looks through its children <Route>s and
            renders the first one that matches the current URL. */}
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

function Home() {
  return <h2></h2>;
}

function About() {
  return <h2></h2>;
}

function Users() {
  return <h2></h2>;
}
